INSERT INTO `projects` (`id`, `name`, `description`, `goal`, `start`, `end`, `state`, `archived`, `importance`, `urgency`, `visible`, `logbook_visible`, `logbook_content`, `responsible_id`, `manager_id`) VALUES
	(1, 'Gestion des finances', 'Travaux à faire pour gérer les dons importants, traiter les demandes de prêt, gérer les dettes, faire des rapports financiers mensuels.', 'Maintenir les rapports à jour tous les mois, améliorer la transparence interne et externe, améliorer le système de dons actuel.', '2020-01-14 13:53:36', '2020-09-27 02:36:43', 5, 0, 3, 2, 1, 1, NULL, NULL, 1),
	(2, 'Crowfunding Festival 2020', 'Campagne de financement participatif pour pouvoir organiser le festival du 14 octobre.', 'Communiquer autour du festival, expliquer les enjeux et les impacts, et inciter les gens à participer au financement participatif. L\'objectif chiffré est de récolter 20\'000 CHF d\'ici au 10 septembre.', '2020-02-28 07:31:46', '2020-05-08 15:41:50', 7, 1, 5, 4, 1, 1, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Est enim mihi magnae curae-quamquam hoc quidem proprium tuum munus est-, ut ita erudiatur, ut et patri et Caepioni nostro et tibi tam propinquo respondeat. Certe nihil nisi quod possit ipsum propter se iure laudari. Quid affers, cur Thorius, cur Caius Postumius, cur omnium horum magister, Orata, non iucundissime vixerit? Duo Reges: constructio interrete. Quarum ambarum rerum cum medicinam pollicetur, luxuriae licentiam pollicetur. Quid e', NULL, 5),
	(3, 'Gestion des communiqués de presse', 'C\'est ici que tous les communiqués de presse qui doivent être validés en coordination seront traités, afin que tout le monde soit au courant et puisse aider si besoin.', 'Assurer la communication à la presse de manière stratégique et réfléchie.', '2019-03-08 12:33:52', '2020-01-25 14:44:30', 0, 0, 3, 2, 1, 0, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. At ille non pertimuit saneque fidenter: Istis quidem ipsis verbis, inquit; Quodsi vultum tibi, si incessum fingeres, quo gravior viderere, non esses tui similis; Duo Reges: constructio interrete. Cum id quoque, ut cupiebat, audivisset, evelli iussit eam, qua erat transfixus, hastam. Atque hoc dabitis, ut opinor, si modo sit aliquid esse beatum, id oportere totum poni in potestate sapientis. Ergo et avarus erit, sed finite, et adulter, ve', NULL, 3),
	(4, 'Collaboration nationale', 'La collaboration nationale de l\'association n\'est pas aisée (étant dans différentes langues) et demande du temps et de l\'énergie', 'Maintenir le lien au national et se coordonner pour les grandes actions.', '2020-08-09 11:54:54', '2020-08-28 01:56:18', 2, 0, 4, 1, 1, 1, NULL, NULL, 3),
	(5, 'Evolution de la structure et du fonctionnement', 'Réfléxion sur comment faire évoluer la structure et le fonctionnement interne de l\'association. Suite à de nombreuses discussions et débats sur diverses questions structurelles et également sur le fonctionnement du travail, des responsabilités et des outils utilisés, ce projet est important doit être considéré avec sérieux afin de pouvoir s\'attaquer à des problèmes complexes et chronophages.', 'Produire un document approfondi sur tous les problèmes et points relevés à l\'interne, afin de les expliquer et de proposer des solutions. Ce document doit être rendu le 12 juillet au soir, nécessitant donc une importante charge de travail durant ces prochaines semaines.', '2019-03-14 00:43:47', '2019-04-24 05:58:01', 1, 0, 5, 4, 1, 1, NULL, NULL, 2),
	(6, 'Réfléxion hiérarchie + égalité des genres', 'Réfléchir en groupe aux différentes hiérarchie dans l\'association ainsi qu\'aux problèmes d\'inégalités des genres et de leur representativité, et également comment résoudre partiellement ou totalement ces problèmes afin d\'arriver à plus d\'égalité et de démocratie.', 'Produire un document qui rassemble toutes les réfléxions et solutions, afin d\'en informer les membres, récolter des retours, améliorer le document, puis en discuter en Coordination lors d\'une AG, finalement de faire des propositions concrètes parmi les différentes solutions. La durée du projet ne devrait pas dépasser 1 mois, c\'est à dire fin septembre.', '2019-05-29 08:47:11', '2020-09-29 09:24:09', 8, 1, 3, 4, 1, 1, 'Contient les décisions importantes, rencontres formelles, changements importants et publications de nouvelles version de document.\r\nImportant, signifie que ce qui est décrit dans l\'enregistrement, a un impact sur le travail de plusieurs personnes du projet.', NULL, 2),
	(7, 'Numéro de août', 'Chaque 5 mois, l\'association collabore avec le journal régional afin de produire un numéro spécial. Ce projet concerne le numéro de août. L\'association s\'occupe des contenus du journal et les journalistes de la partie impression, administrative, financière, crédits et organisation de la distribution.', 'Produire une édition de 32 pages qui sera publiée le 25 aoùt, avec des articles, dessins, illustrations et images noir et blanc. Le projet a pour objectif d\'augmenter la visibilité médiatique des sujets traités par l\'association, et de mobiliser pour les actions organisées ces prochains mois.', '2020-08-06 02:25:43', '2020-09-23 14:03:22', 2, 0, 5, 3, 1, 1, NULL, NULL, 4),
	(8, 'Numéro de janvier', 'Chaque 5 mois, l\'association collabore avec le journal régional afin de produire un numéro spécial. Ce projet concerne le numéro de janvier 2021. \n L\'association s\'occupe de pratiquement tous les contenus du journal et les journalistes de l\'édito, de la partie impression, administrative, financière, crédits et organisation de la distribution.\n\n Ce projet est planifié très à l\'avance afin de pas l\'oublier et de commencer à y réfléchir personnellement sur les sujets à aborder et la forme souhaitée. Le travail commencera en septembre. L\'édition étant plus courte, le travail devrait être allégé par rapport à l\'édition de août.', 'Produire une édition de 20 pages qui sera publiée le 30 janvier, avec des articles, dessins, illustrations et images en couleur. Le projet a pour objectif d\'augmenter la visibilité médiatique des sujets traités par l\'association, et de mobiliser pour les actions organisées ces prochains mois.', '2019-02-19 05:44:52', '2019-11-26 09:17:30', 8, 1, 4, 1, 1, 1, NULL, NULL, 4),
	(9, 'Festival 2020', 'Edition 2020 du festival annuel de l\'association qui aura lieu le 14 octobre 2020. Un gros projet comme tous les ans, un programme ambitieux et chargé, des intervenant externes, des films, des conférences, des débats public et entre intervenants, des ateliers, ... \nLe thème de 2020 est la mobilisation, sous toutes les formes, à travers les siècles, en ligne et dans la rue, avec la repression, sous la forme de la désobéissance civile, les réussites et les echecs, ce qu\'il est possible d\'atteindre avec, ...', 'Proposer un maximum de diversités dans la programmation, les événements, tout en se concentrons sur le thème de la mobilisation. Le but est aussi de toucher un maximum de gens de la région sur les problèmatiques qui concerne l\'association.', '2020-07-13 02:20:01', '2020-09-12 23:28:01', 5, 0, 5, 3, 1, 1, 'Contient les décisions importantes, rencontres formelles, changements importants et publications de nouvelles version de document.\r\nImportant, signifie que ce qui est décrit dans l\'enregistrement, a un impact sur le travail de plusieurs personnes du projet.', NULL, 1),
	(10, 'Festival 2019', 'Edition 2019 du festival annuel de l\'association qui a eu lieu le 25 octobre 2019. Un premier festival qui sera renouvellera on espère, avec des films et des conférences, mais aussi de la musique, de la restauration et des chaises longues. \nLe thème de 2020 est la grève, sous toutes les formes, à travers les siècles, l\'évolution des risques légaux depuis 1900, ses réussites, le côté émotionnel, ...', 'Organiser un premier festival. Le but est aussi de toucher un maximum de gens de la région sur les problèmatiques qui concerne l\'association. L\'experience aquise servira au festival de l\'année 2020 qui promet d\'être ambitieux.', '2019-07-30 07:40:56', '2019-12-29 00:30:28', 2, 0, 5, 5, 1, 0, NULL, NULL, 5),
	(11, 'Affiche festival 2020', 'L\'affiche étant médiocre l\'année passée sur le festival 2019, le GT multimédia s\'associe au GT Festival afin de faire un belle affiche pour cette année.', 'Réaliser de A à Z une affiche de bonne qualité pour le 23 septembre 2020 (3 semaines plus tôt). La réalisation comprend: les réfléxions sur le contenu, le design et la création de l\'affiche, la demande de retours à mi parcours, la publication sur les réseaux sociaux et l\'impression papier et la distribution/affichage.', '2019-01-30 09:26:00', '2019-10-28 14:05:12', 3, 0, 3, 1, 1, 1, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Expressa vero in iis aetatibus, quae iam confirmatae sunt. Et ego: Piso, inquam, si est quisquam, qui acute in causis videre soleat quae res agatur. Quid, cum fictas fabulas, e quibus utilitas nulla elici potest, cum voluptate legimus? Ita, quem ad modum in senatu semper est aliquis, qui interpretem postulet, sic, isti nobis cum interprete audiendi sunt. Idque testamento cavebit is, qui nobis quasi oraculum ediderit nihil post mortem ad ', NULL, 5),
	(12, 'Vidéo 1er mai', 'Le 1er mai 2021 c\'est la fête des travailleur.euses. Différentes manifestations seront organisées dans plusieurs villes dans tous le pays. Le projet consiste à filmer les manifestations dans plusieurs villes et d\'en faire une compilation sous la forme d\'un reportage tout en expliquant le contexte historique de cette fête et de ce qu\'elle symbolise aujourd\'hui.', 'Réaliser une vidéo de 5-10 minutes avec les meilleurs images des manifestations et tenter de répondre aux questions suivantes: quelle rôle a cette fête ? Comment est-elle apparue (contexte historique) ? Quelle est sa place et son impact aujourd\'hui ?\n\n La vidéo devrait être publiée sur les réseaux sociaux, maximum 3 jour après le 1er mai, c\'est à dire jusqu\'au 4 mai 2020.', '2018-08-03 13:55:25', '2020-10-03 07:39:10', 6, 1, 3, 4, 0, 1, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Si verbum sequimur, primum longius verbum praepositum quam bonum. Primum non saepe, deinde quae est ista relaxatio, cum et praeteriti doloris memoria recens est et futuri atque inpendentis torquet timor? Ut necesse sit omnium rerum, quae natura vigeant, similem esse finem, non eundem. Similiter sensus, cum accessit ad naturam, tuetur illam quidem, sed etiam se tuetur; Duo Reges: constructio interrete. Nec lapathi suavitatem acupenseri Ga', NULL, 8),
	(13, 'Podcast convergence des luttes', 'Ce podcast engagé va parler de la convergence des luttes écologiques, féministes, sociales, anti-racistes et autres luttes. Il est prévu que ce podcast contienne entre 4 et 6 épisodes avec différentes thématiques. Les épisodes contiendront des interviews, des explications historiques, un peu de musique, des mises en scène, ... \n\nChaque épisode durera en moyenne 20 minutes et seront publiés à des intervalles régulières d\'environ 1 semaine. Une partie des épisodes seront réalisés avant la publication du premier épisode, une autre partie se fera en parallèle.', 'Parler de l\'importance de la convergence des luttes, parler des liens entre les différentes luttes et mouvements, donner des exemples concrets de mobilisation et de succès suite à des convergences.', '2019-09-25 08:09:46', '2020-08-15 10:48:40', 2, 0, 5, 3, 1, 1, 'Contient les décisions importantes, rencontres formelles, changements importants et publications de nouvelles version de document.\r\nImportant, signifie que ce qui est décrit dans l\'enregistrement, a un impact sur le travail de plusieurs personnes du projet.', NULL, 6),
	(14, 'Gestion Site Assoc Vaud', 'Gestion du site web: page à créer à chaque événement organisé, communiqués de presse à publier, et informations générales à tenir à jour.', 'Permettre aux personnes intéressées par le collectif de trouver les informations qu\'elles recherchent sur le collectif et qu\'elles aient un moyen de rejoindre.', '2020-05-18 22:39:28', '2020-10-04 12:26:33', 4, 0, 2, 2, 1, 1, 'Contient les décisions importantes, rencontres formelles, changements importants et publications de nouvelles version de document.\r\nImportant, signifie que ce qui est décrit dans l\'enregistrement, a un impact sur le travail de plusieurs personnes du projet.', 99, 7),
	(15, 'Conférence "Changement de système ?"', 'Conférence en ligne de 1h30 environ sur la nécessité de changer de système. Avec divers intervenant.e.s.', 'Organiser cette conférence pour la fin mars 2021 afin de montrer ce que signifie un changement de système et à quoi cela peut ressembler.', '2018-12-01 01:05:42', '2019-02-08 10:02:43', 6, 1, 5, 3, 1, 1, NULL, 56, 9),
	(16, '20ème anniversaire', 'Pour bien fêter les 20 ans de Assoc, il faut organiser autre chose que l\'habituel apéro annuel avec discours. Ce projet reste secret pour les membres (sauf pour les personnes du GT Anniversaire du collectifs afin de faire une surprise à la fin. Cette fête ferait office de remerciement aux membres du collectif pour leur engagement et leur temps.', 'Organiser une grande fête dans la salle du Château le 15.12.2020 qui durerait toute la nuit. Inclut dans le programme: musique, présentations des projets de l\'année, anecdotes, sketchs, ...', '2018-10-25 16:02:33', '2019-04-29 23:52:56', 8, 1, 4, 4, 0, 1, 'Contient les décisions importantes, rencontres formelles, changements importants et publications de nouvelles version de document.\r\nImportant, signifie que ce qui est décrit dans l\'enregistrement, a un impact sur le travail de plusieurs personnes du projet.', 82, 12);
