	(2, 'vincent95', 'VRT', 'Vincent', 'Rigot', '', 'vincent.rigot@assoc.ch', '4093324554', 'Je suis passionné de litérrature, et la presse me questionne beaucoup aujourd\'hui. Les sujets polémiques ne sont pas les plus intéressants, mais ceux dont on ne parle jamais regorgent d\'informations passionnantes et de récits fabuleux.', '$2y$10$9J4CEA9XJfoSlCyi94gYEesPdl2e1Hb6RefGQXCNPOtig/qBKkq7O', '2019-03-25 21:34:10', 0, 'Actuellement en travail intense sur la rédaction d\'un document contenant des réflexions autour du militantisme à l\'époque des Romains!', 3, 1, '2019-09-07 15:24:12'),
	(3, 'megane85', 'MBN', 'Mégane', 'Blan', 'chat.link/user?t=wyvdae79b7mdr3', 'megane.blan@assoc.ch', '7554132058', 'Je suis une passionée de festival. J\'en vais 4 fois par mois. Je trouvais le festival de Assoc vraiment génial alors j\'ai voulu venir ajouter mon grain de sel et aider pour la communication. Je suis fan de musique et je joue du violon. Je consacre 5h par semaine à Assoc la plupart de l\'année, et tout mon temps quand il y a le festival...', '$2y$10$ujnWInwGD5iLQmmDFAxgWuDiu4N5IU0b5waOXhzeCoOfzoWRhJv5q', '2020-10-04 16:22:17', 0, 'Encore quelques jours de repos avant de commencer à travailler à fond pour le festival. J\'aimerai que cette édition soit exceptionnelle!', 1, 1, '2020-10-05 16:47:33'),
